var current = 'FruitAndVegetables';
$(".products-wrap").prepend(window['FruitAndVegetables']);
$.each([ 'dairy', 'Snacks', 'FruitAndVegetables', 'Grocery', 'Drinks' ], function( index, value ) {
	$('#' + value).click(function () {
		window[current] = $(".products-wrap").html();
		$(".products-wrap").empty();
		$(".products-wrap").prepend(window[value]);
		current = value;
	});
});
